import React from "react";
import "./SmallerBanner.css";

export default function SmallerBanner() {
  return (
    <div className="smallBanner">
      <div className="playStation">playstaion</div>
      <div className="macBook">macpro</div>

      <div className="miniGrid">
        <div className="visionPro">vison pro</div>
        <div className="airpod">airpod</div>
      </div>
    </div>
  );
}
